        if (!nivel) return;
        if (typeof nivel !== "string") return;
        let scene_rayo = this.scene.get('SceneRayo');
        scene_rayo.scene.switch(nivel);
        scene_rayo.scene.resume();
        this.mostrarHud("hud");        
    }

